    const raw = JSON.stringify({
        model: "gpt-4",
        messages: [
            {
                role: "system",
                content: customInstruction
            },
            {
                role: "user",
                content: prompt
            }
        ],
        temperature: 0,
        max_tokens: max_tokens
    });
